import React, { Component } from "react";
import { Link } from "react-router-dom";

export default class Navbar extends Component {
  render() {
    return (
      <div>
        <ul>
          <li>
            <Link to="/cart">
              <i class="fas fa-shopping-cart" />
            </Link>
          </li>

          <li></li>
        </ul>
      </div>
    );
  }
}
